import { useState } from "react";
import { useEffect } from "react";
import { useHistory } from "react-router-dom/cjs/react-router-dom.min";
import "react-toastify/dist/ReactToastify.css";
import { ToastContainer, toast } from "react-toastify";

function ViewAllDoctors() {
    const history=useHistory();

    const [doctorInactive,setDoctorInactive]=useState([{
        firstName: "",
        lastName: "",
        gendeer: "",
        email: "",
        mobNumber: "",
        password: "",
        addressLineOne: "",
        addressLineTwo: "",
        experience: 0,
        speciality: "",
        charges: 0,
        imagePath: "",
        id: 0
      }]);

      const [doctorActive,setDoctorActive]=useState([{
        firstName: "",
        lastName: "",
        gendeer: "",
        email: "",
        mobNumber: "",
        password: "",
        addressLineOne: "",
        addressLineTwo: "",
        experience: 0,
        speciality: "",
        charges: 0,
        imagePath: "",
        id: 0
      }]);

  const Home=()=>{
    history.push("/HospitalHome");
}

const loadActive=()=>{
  var helper=new XMLHttpRequest;
  helper.onreadystatechange=()=>{
      if(helper.readyState==4&&helper.status==200){
          var data=JSON.parse(helper.responseText);     
          //console.log(data);
          setDoctorActive(data);
      }
  };
  helper.open('GET','http://localhost:7070/doctor/status/active');
  helper.setRequestHeader("Content-Type","application/json");
  helper.send();
}
const loadInactive=()=>{
  var helper=new XMLHttpRequest;
  helper.onreadystatechange=()=>{
      if(helper.readyState==4&&helper.status==200){
          var data=JSON.parse(helper.responseText);     
          //console.log(data);
          setDoctorInactive(data);
      }
  };
  helper.open('GET','http://localhost:7070/doctor/status/inactive');
  helper.setRequestHeader("Content-Type","application/json");
  helper.send();
}

useEffect(()=>{
  loadActive();
  loadInactive();
},[]);

const active=(id)=>{
  //http://localhost:7070/hospital/status/actine/{hId}?hId=11
  var helper=new XMLHttpRequest;
  helper.onreadystatechange=()=>{
      if(helper.readyState==4&&helper.status==202){
        toast.success("Doctor Activated Successfully!!!", {
          position: "top-center",
          autoClose: 1000,
          hideProgressBar: false,
          closeOnClick: true,
          pauseOnHover: true,
          draggable: true,
          progress: undefined,
        });
        window.setTimeout(()=>{
          loadActive();
          loadInactive();
      },2000);
      }
  };
  helper.open('PUT','http://localhost:7070/doctor/status/active/{dId}?dId='+id);
  helper.setRequestHeader("Content-Type","application/json");
  helper.send();
}

const remove=(id)=>{
  //http://localhost:7070/hospital/status/inactine/{hId}?hId=
  var helper=new XMLHttpRequest;
  helper.onreadystatechange=()=>{
      if(helper.readyState==4&&helper.status==202){
        toast.success("Doctor Removed Successfully!!!", {
          position: "top-center",
          autoClose: 1000,
          hideProgressBar: false,
          closeOnClick: true,
          pauseOnHover: true,
          draggable: true,
          progress: undefined,
        });
        window.setTimeout(()=>{
          loadActive();
          loadInactive();
      },2000);
      }
  };
  helper.open('PUT','http://localhost:7070/doctor/status/inactive/{dId}?dId='+id);
  helper.setRequestHeader("Content-Type","application/json");
  helper.send();
}

